import React from 'react';
import './index.css';
const axios = require('axios');

export default class TestScreen extends React.PureComponent {
    constructor(props) {
        super(props);
        this.state = {}
    }

    componentDidMount = async () => {
        try {
            const res = await axios.get('http://localhost:5000/mockTest/');
            console.log('res', res);
        }
        catch (err) {
            console.log('err', err);
        }
    }

    render() {
        return (
            <div className="container">
                This is the Test Screeen
            </div>
        )
    }
}
